  }
  function LoadData(id:any){
    fetch('http://192.168.1.107:45455/api/items/'+id).then((response)=>response.json()).then((data)=>console.log(data))

  }
  LoadId()  ;

    return (
        <View>
          <Text>itemId: {(itemId)}</Text>
        </View>
  );
}

const styles = StyleSheet.create({
    container: {
      alignItems: 'center',
